import React from 'react';

const ImageLink = () =>{
    return(
        <div>
            <p>{'Hello'}</p>
            <div>
            <input type="text" className='f4 pa2  w-70 center'></input>
            <button className='w-30 grow f4 link ph2 pv2 dib white bg-light-purple '>Search</button>
        </div>
        </div>
    );
}

export default ImageLink;
